import React from "react";
import "./style.css";

function SearchResults(props) {
  return (
    <ul className="list-group search-results">
      <li className="list-group-item">
        <h2>{props.title}</h2>
        <p>{props.description}</p>
        <a href={props.url}>{props.url}</a>
      </li>
    </ul>
  );
}

export default SearchResults;
